    true,nt"url": null,nt"notes": "The Private School Universe Survey, 2007-08
    (PSS 2007-08), is a study that is part of the Private School Universe Survey program.
    PSS 2007-08 (http://nces.ed.gov/surveys/pss/) is a cross-sectional survey that builds
    an accurate and complete universe of private schools to serve as a sampling frame
    for NCES surveys of private schools and generates biennial data on the total number
    of private schools, teachers, and students. The study was conducted using surveys
    of administrative personnel. The studyufffds response rate was 91.8 percent. Key
    statistics produced from PSS 2007-08 are religious orientation, level of school,
    length of school year, length of school day, total enrollment (K-12), race/ethnicity
    of students, number of high school graduates, number of teachers employed, program
    emphasis, and existence and type of kindergarten program.",nt"owner_org": "8c0bc869-1189-4ced-af26-2abd2337b886",nt"extras":
